// pages/cars/detail/detail.js

var tool = require("../../common/tool.js")

var app = getApp();
Page({

  /**
   * 页面的初始数据
   */
  data: {
    keyNames: ['name', 'cab', 'maxSpeed', 'I', 'II', 'III', 'IV'],
    //edit时使用
    values: ['', '', '', , '', '', , '', ''],
    isAdd: true,
    id: '',

    car: null, //如果是修改
    cars: null
  },


  /**
   * 生命周期函数--监听页面加载
   */
  onLoad: function(options) {
    console.log("onlaod方法出发", options)
    this.data.isAdd = (options.isAdd == '1')
    this.data.id = options.id;
    this.data.cars = app.globalData.cars;
    if (!this.data.isAdd) {
      var cars = app.globalData.cars;
      for (var i in cars) {
        if (cars[i].id == this.data.id) {
          this.data.car = cars[i];
        }
      }
      console.log(cars, this.data.car)
      var car = this.data.car;
      this.setData({
        values: [car.name, car.cab, car.maxSpeed, car['I'].value, car['II'].value, car['III'].value, car['IV'].value]
      })
    } else {
      this.setData({
        values: ["", "", "126", "15", "30", "50", "80"]
      })
    }
  },

  //提交数据
  formSubmit: function(e) {

    var isNull = false;
    var value = e.detail.value;
    console.log(value)
    for (var i in value) {
      if (this.isNull(value[i])) {
        isNull = true;
        break;
      }
    }
    if (isNull) {
      wx.showToast({
        title: '数据不完整',
        icon: 'none',
        duration: 2000
      })
      return;
    }
    var cabValue = parseInt(e.detail.value.cab)
    if (cabValue > 10239 || cabValue < 1) {
      wx.showToast({
        title: '地址需要在1~10239之间',
        icon: 'none'
      })
      return;
    }

    var length = 0;
    for (var i = 0; i < this.data.cars.length; i++) {
      if (this.data.cars[i].name == value.name) {
        break;
      }
      length++;
    }
    if (length != this.data.cars.length) {
      wx.showToast({
        title: '机车名字重复,请重新命名',
        icon: 'none'
      })
      return;
    }

    var oneS = parseInt(e.detail.value['I'])
    var twoS = parseInt(e.detail.value['II'])
    var threeS = parseInt(e.detail.value['III'])
    var fourS = parseInt(e.detail.value['IV'])
    if ((oneS > twoS || twoS > threeS) || threeS > fourS) {
      wx.showToast({
        title: '请设置档位依次递增',
        icon: 'none'
      })
      return;
    }

    if (this.data.isAdd) {
      var timestamp = new Date().getTime() + '';
      value.id = timestamp;
      value.isDefault = false;
      value.isSelected = false;
      value.speed = 0;
      value.register = 1;
      value.direction = 0;
      value.type = "数码";
      value.image = null;
      value['I'] = {
        name: 'I',
        value: parseInt(value['I']),
        isSelected: false
      }
      value['II'] = {
        name: 'II',
        value: parseInt(value['II']),
        isSelected: false
      }
      value['III'] = {
        name: 'III',
        value: parseInt(value['III']),
        isSelected: false
      }
      value['IV'] = {
        name: 'IV',
        value: parseInt(value['IV']),
        isSelected: false
      }
      value.maxSpeed = parseInt(value.maxSpeed)

      for (let i = 0; i <= 28; i++) {
        value['F' + i] = {
          name: 'F' + i,
          isSelected: false,
          minName: 'F' + i,
        };
      }
      app.globalData.cars.push(value);

    } else {
      var cars = app.globalData.cars;
      for (var j in cars) {
        if (cars[j].id == this.data.id) {
          for (var key in value) {
            if (key == 'name' || key == 'cab') {
              cars[j][key] = value[key]
            } else if (key == 'maxSpeed') {
              cars[j][key] = parseInt(value[key])
            } else {
              cars[j][key].value = parseInt(value[key])
            }
          }
        }
      }
    }

    var newCars = [].concat(app.globalData.cars)
    var moni = newCars.shift()
    var theCars = this.executive(newCars)
    theCars.unshift(moni)

    app.globalData.cars = theCars;

    this.storageCars();
    
    wx.showToast({
      title: '操作成功',
      icon: 'none'
    })
    setTimeout(() => {
      wx.navigateBack({

      })
    }, 1000);
    /**
        id: '00000002',
        isSelected: false,
        speed: 0,
        register: 1,
        direction: 0,
        'type': '模拟',
        'name': '模拟',
        'image': null,
        'cab': '99',
        'maxSpeed': 126
     */
  },


  bindinput: function(e) {
    var index = e.currentTarget.dataset.index
    if (index != 0) {
      var valueStr = e.detail.value;
      if (tool.isNull(valueStr)) {
        return;
      }
      var value = parseInt(valueStr);
      if (isNaN(value)) {
        return '';
      }
      if (index == 1) {

        if (value > 10239) {
          wx.showToast({
            title: '地址需要在1~10239之间',
            icon: 'none'
          })
          return parseInt(value / 10);
        }
      } else if (index == 2) {

      } else if (index == 3 || index == 4 || index == 5 || index == 6) {
        if (value > 100) {
          wx.showToast({
            title: '速度为百分比,请在0~100之间取值',
            icon: 'none'
          })
          return parseInt(value / 10);
        }
      }
    }

  },

  isNull: function(a) {
    // String    
    if (a == "" || a == null || a == undefined) { // "",null,undefined
      return true;
    }
    if (!a) { // "",null,undefined,NaN
      return true;
    }
    return false;
  },


  /**
   * 生命周期函数--监听页面初次渲染完成
   */
  onReady: function() {

  },

  executive: function(objNames) { //得到一串首字母数组
    var strChineseFirstPY = "";



    var isEnglishOrNum = /^[A-Za-z0-9]+$/; //正则验算是否英文字母或数字
    var arr = []; //存储各字符串首字母
    var j = 0;
    for (var i = 0; i < objNames.length; i++) {
      var obj = objNames[i]
      var str = obj.name
      if (Object.prototype.toString.call(str) === "[object String]") { //判断是否为字符串
        var sing = str.substring(0, 1); //截取字符串首个字符
        var ch = str.charCodeAt(0); //获取字符对应Unicode编码值
        if (isEnglishOrNum.test(sing)) { //判断是否为英文字母或数字
          arr[j++] = sing.toUpperCase(); //是则将字符赋值给数组
        } else {

          if (ch < 40869 && ch >= 19968) { //判断字符编码值在19968到40869之间
            arr[j++] = strChineseFirstPY.charAt(ch - 19968); //获取对应表中的字母并赋值到数组        
          } else {
            console.log("字符串首字母仅支持字母和数字");
            return false;
          }
        }
      } else {
        console.log("请检查您输入的字符串数组是否有误" + str);
        return false;
      }
    }
    //判断首字母数组
    var pinYin = arr;
    var arry = [];
    for (var i = 0; i < pinYin.length; i++) {
      arry[i] = pinYin[i];
    }
    var temp;
    var arrangeLi = "";
    for (var i = 0; i < pinYin.length - 1; i++) { //将出现的字符按ascii顺序由小到大存进数组
      for (var j = 0; j < pinYin.length - 1 - i; j++) {
        if (pinYin[j] > pinYin[j + 1]) {
          temp = pinYin[j];
          pinYin[j] = pinYin[j + 1];
          pinYin[j + 1] = temp;
        }
      }
    };
    var pinYin2 = [];
    for (var i = 0; i < pinYin.length; i++) { //生成拥有的字符
      if (pinYin[i] != pinYin[i - 1]) {
        pinYin2.push(pinYin[i])
      }
    };

    var resultArr = [];
    for (var j = 0; j < pinYin.length; j++) {

      for (var i = 0; i < objNames.length; i++) {
        var obj = objNames[i]
        var str = obj.name
        if (Object.prototype.toString.call(str) === "[object String]") { //判断是否为字符串
          var sing = str.substring(0, 1); //截取字符串首个字符
          var ch = str.charCodeAt(0); //获取字符对应Unicode编码值
          if (isEnglishOrNum.test(sing)) { //判断是否为英文字母或数字
            if (pinYin2[j] == sing || pinYin2[j] == sing.toUpperCase()) {
              resultArr.push(obj)
            }
          }
        } else {
          console.log("请检查您输入的字符串数组是否有误2");
          return false;
        }
      }

      for (var k = 0; k < objNames.length; k++) {
        var obj = objNames[k]
        var str = obj.name
        if (Object.prototype.toString.call(str) === "[object String]") { //判断是否为字符串
          var sing = str.substring(0, 1); //截取字符串首个字符
          var ch = str.charCodeAt(0); //获取字符对应Unicode编码值
          if (isEnglishOrNum.test(sing)) { //判断是否为英文字母或数字

          } else {

            if (ch < 40869 && ch >= 19968) { //判断字符编码值在19968到40869之间
              var ccc = strChineseFirstPY.charAt(ch - 19968);
              if (ccc == pinYin2[j]) {
                resultArr.push(obj)
              }
            } else {
              console.log("字符串首字母仅支持字母和数字");
              return false;
            }
          }
        } else {
          console.log("请检查您输入的字符串数组是否有误");
          return false;
        }
      }
    }
    return resultArr;
  },

  
  storageCars: function () {
    var cars = JSON.parse(JSON.stringify(app.globalData.cars))
    for (var i = 0; i < cars.length; i++) {
      var car = cars[i]
      car.speed = 0;
      car.register = 1;
      car.direction = 0;
      for (let i = 0; i <= 28; i++) {
        car[`F${i}`].isSelected = false
      }
      var dangName = ["IV", "III", "II", "I"]
      for (let j = 0; j < 4; j++) {
        var name = dangName[j]
        car[name].isSelected = false
      }
    }
    wx.setStorage({
      key: 'cars',
      data: cars,
    })
  },
})